import React from 'react';
import './Card.css';
const Card = ({ title, description, image }) => {
  return (
    <div style={{
      border: '1px solid #ccc',
      borderRadius: '8px',
      padding: '16px',
      margin: '10px',
      width: '220px',
      boxShadow: '2px 2px 6px rgba(0,0,0,0.1)',
      textAlign: 'center',
      color:"black",
      backgroundColor:"white"
    }}>
      <img 
        src={image} 
        alt={title} 
        style={{ width: '100%', height: '200px', objectFit: 'cover', borderRadius: '2px' }} 
      />
      <h3>{title}</h3>
      <p>{description}</p>
    </div>
  );
};

export default Card;
